import { rackLogs } from "./RackLogs";

function RackGraph({type, logs, rack}){
    const valueKey =
        type === "current"
        ? "current"
        : type === "hour"
        ? "energyHour"
        : type === "day"
        ? "energyDay"
        : "energyMonth"; 
    return (
        <LineChart width={440} height={240} data={logs}>
            <XAxis dataKey="time"/>
            <YAxis/>

            <ReferenceArea
                y1={rack.lowerWarning}
                y2={rack.upperWarning}
                fill="lightgreen"
                fillOpacity={0.3}
            />

            <ReferenceArea
                y1={rack.upperWarning}
                y2={rack.upperAlarm}
                fill="yellow"
                fillOpacity={0.3}
            />

            <ReferenceArea
                y1={rack.upperAlarm}
                y2={rack.max}
                fill="red"
                fillOpacity={0.3}
            />
            <Tooltip/>
            <Line
                type="monotone"
                dataKey={valueKey}
                stroke="#2563eb"
                dot={false}
            />
        </LineChart>

    )

}

export default RackGraph;
